import { Box, Text, Center, Icon, VStack } from "@chakra-ui/react";
import { Link } from "react-router-dom";
import styles from "./featureIcons.module.css";

export default function FeatureIcon({ icon, link, heading, subheading }) {
  return (
    <Center>
      <VStack p={4} display={{ md: "flex" }} className={styles.container}>
        <Box flexShrink={0} className={styles.box}>
          <Link to={link}>
            <Icon as={icon} className={styles.myIcon} />
          </Link>
        </Box>
        <Box className={styles.textBox}>
          <Text>{heading}</Text>
          <Text fontSize="1rem" fontWeight="semibold">
            {subheading}
          </Text>
        </Box>
      </VStack>
    </Center>
  );
}
